import './App.css';
import { BrowserRouter as Router, Route,Switch } from 'react-router-dom';
import Footer from './Components/Footer';
import Header from './Components/Header';
import SideBar from './Components/SideBar';
import AddStaffMember from './Pages/StaffMembers/Add'
import ViewStaffMember from './Pages/StaffMembers/Viewall'
function App() {
  return (
    <div className="App">
     <Header/>
     <SideBar/>
     <div className="page">
        <div className="page-content">
        <Switch>
            <Route exact path="/StaffMembers/Add" component={AddStaffMember} />
            <Route exact path="/StaffMembers/View" component={ViewStaffMember} />
        </Switch>
        </div>
      </div>
     <Footer/>
    </div>
  );
}

export default App;
